The Critical Section Problem : 
Consider a system consisting of n processes {Po,P1, ..., Pn -1). Each process has a segment of code, called a 
critical section , in which the process may be changing common variables, updating a table, writing a file, and 
so on. The important featur e of the system is that, when one process is executing in its critical section, no other 
process is to be allowed to execute in its critical section. Thus, the execution of critical sections by the processes 
is mutually exclusive in time. The critical -section problem is to design a protocol that the processes can use to 
cooperate. Each process must request permission to enter its critical section. The section of code implementing 
this request is the entry section. The critical section may be followed by an exit section. The remaining code is 
the remainder section.  


