Semaphores : 
The solutions to the critical -section problem presented before are not easy to generalize to more 
complex problems. To overcome this difficulty, we can use a synchronization tool called a semaphore. A 
semaphore S is an integer variable that, apart from ini tialization, is accessed only through two standard 
atomic operations: wait and signal . These operations were originally termed P (for wait; from the Dutch 
proberen, to test) and V (for signal; from verhogen, to increment). The classical definition of wait in 
pseudocode  is 

Wait(S) {  
while (S <=  0); 
 // no-op  
    S --; 
} 

The classical definitions of signal in pseudocode is  

Signal(S){  
S++;  
} 

Modifications to the integer value of the semaphore in the wait and signal operations must be 
executed indivisibly. That is, when one process modifies the semaphore value, no other process can 
simultaneously modify that same semaphore value. In addition, in the case of the wait (S), the testing of the 
integer value of S (S 5 O), and its possible modificatio n (S--), must also be executed without  interruption.  

