1. The Bounded -Buffer Problem  
The bounded -buffer problem is commonly used to illustrate the power of synchronization primitives. 
We present here a general structure of this scheme, without committing ourselves to any particular 
implementatio n. We assume that the pool consists of n buffers, each capable of holding one item. The mutex 
semaphore provides mutual exclusion for accesses to the buffer pool and is initialized to the value 1. The 
empty and full semaphores count the number of empty and  full buffers, respectively. The semaphore empty 
is initialized to the value n; the semaphore full is initialized to the value  0. 
The code for the producer process is  

do{ 
produce an item in nextp  
... 
wait (empty) ;  
     wait (mutex) ;  
... 
add nextp to buffer  
. . . 
signal(mutex);  
     signal (full) ;  
} while (1);  
The code for the consumer process is : 
 do{ 
wait (full) ;  
wait (mutex) ;  
…. 
remove an item from buffer to nextc  
….. 
signal (mutex) ;  
signal (empty) ;  
... 
consume the item in nextc  
... 
} while (1); 

Note the symmetry between the producer (p) and the consumer (c). We can interpret this code as the producer 
producing full buffers for the consumer, or as the consumer producing empty buffers for the producer.  

2. The Readers - Writers Problem  
A data object (such as a file or record) is to be shared among several concurrent processes. Some of 
these processes may want only to read the content of the shared object, whereas others may want to update 
(that is, to read and write) the shared object. We distinguish between these two types of processes by referring 
to those processes that are interested in only reading as readers, and to the rest as writers. Obviously, if two 
readers access the shared data object simultaneously, no adverse effects will r esult. However, if a writer and 
some other process (either a reader or a writer) access the shared object simultaneously, chaos may ensue.  

To ensure that these difficulties do not arise, we require that the writers have exclusive access to the 
shared obje ct. This synchronization problem is referred to as the readers -writers problem. Since it was 
originally stated, it has been used to test nearly every new synchronization primitive. The readers -writers 
problem has several variations, all involving prioritie s. The simplest one, referred to as the first readers -
writers problem, requires that no reader will be kept waiting unless a writer has already obtained permission 
to use the shared object. In other words, no reader should wait for other readers to finish simply because a 
writer is waiting. The second readers -writers problem requires that, once a writer is ready, that writer 
performs its write as soon as possible. In other words, if a writer is waiting to access the object, no new 
readers may start reading.  

A solution to either problem may result in starvation. In the first case, writers may starve; in the 
second case, readers may starve. For this reason, other variants of the problem have been proposed. In this 
section, we present a solution to the first r eaders -writers problem.  
